(15 comments)

Lots of comments here;

This find_if loop is clever, but it adds a lot of complex code that we prefer to avoid.  If this were rewritten in the "normal" way

for sensor in sensors:
   if sensor.name != "cpu_kernel" && sensor.name != "CPU_User":
      continue

   ... read in sensor value.



It would be a lot less code, and much more readable.

